export default function SearchBar({onSearch}) {
   return (
      <div
         style={{
            display: 'flex',
            margin:0,
            width: '100%',
            justifyContent: 'center',
            marginRight: 100,
         }}
         >
         <input 
            type='search' 
            placeholder='Buscar...'
            style={{
               border: '5px',
               borderRadius: '30px',
               width: '20%',
               backgroundColor: 'rgba(255, 255, 255, 0.781)',
            }}
         />
         <button 
            style={{height: 40, borderRadius: 5 }}
            onClick={() => onSearch(1)}
         >
            Agregar
         </button>
      </div>
   );
}
